import style from "styled-components";

const iconOption = ["person" ,"shopping_cart", /*"menu", "more_vert"*/];

const Icons = style.ul`
    align-items: center;
    display: flex;
    justify-content: center;
    width: 500px;
`;

const IconList = style.li`
    align-items: center;
    cursor: pointer;
    display: flex;
    justify-content: center;
    width: 1.563rem;
    margin: 0 1.4rem;
`;

function OptionsIconHeader() {
    return (
        <Icons>
            {iconOption.map((icon, key) => 
            <IconList key={key}>
                <span className="material-icons">{icon}</span>
            </IconList>)}
        </Icons>
    )
};

export default OptionsIconHeader;
